Diagnosis. Specimens of
Glyptasida sordida
are diagnosed on the basis of the following unique combination of characteristics: Pronotum with very coarse and close punctures (
Fig. 10
), discal costae of elytra elevated, with gradual change in elevation between the lateral elytral margin and the lateral costa (
Fig. 4
), elytral setae with node at base (
Fig. 12
).

Description. With general features of
Glyptasida
, and the following specific characteristics: GHW 2.5–4.4 mm ; GPW 5.2–9.6 mm ; GEW 7.2–13.2 mm ; HL 1.9–3.9 mm ; PL 3.3–5.5 mm ; EL 7.1–18.7 mm ; TL 15.3 –27.0 mm; Ratio of PW/GEW 0.50–0.95 . Body stout, dull black, in some specimens appearing brown due to debris between costae; pronotum with or without pronounced acute hind angles; pronotal punctures coarse (
Fig. 10
), punctures close, in some specimens overlapping (
Fig. 10
); discal costae of elytra elevated, with gradual change in elevation between the lateral elytron margin and the lateral costa (
Fig. 4
); elytral setae with nodes at base (
Fig. 12
). Male genitalia with median lobe rounded basally (
Fig. 20
).

Distribution. The geographic range of this species is northern Mexico to southern Canada and western Utah to mid Kansas (
Fig. 28
).
